  [],\n\t\"revision_timestamp\": \"2016-07-27T22:19:59.569874\",\n\t\"name\": \"howland-national-wildlife-refuge-comprehensive-conservation-plan\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This Comprehensive Conservation Plan (CCP)
  was written to guide management on Howland NWR for the next 15 years. This plan
  outlines the Refuge vision and purpose and describes how Howland NWR will contribute
  to the overall mission of the Refuge System. The plan provides an introduction to
  the Refuge, an overview of the CCP process, information on the management direction,
  and a description of Refuge resources. Key planning issues include: operational
  limitations, biological and ecological resources, external forces, public use resources,
  education and outreach, and communication and cooperation.\",\n\t\"license_title\":
